import {UserContext} from '../src/lib/UserContext'
import { seeIfLogin } from '../src/lib'

const Dashboard: React.FC = () => {
    const { api, setToken } = useContext(UserContext)

    useEffect(() => {
        seeIfLogin(api, setToken, () => OpenPage('/'))
    }, [])

    return (
        <>
            <Head>
